INSERT INTO `odgovor` (`idOdgovor`, `pitanje_idPitanje`, `korisnik_idKorisnik_odgovorio`, `tekstOdgovora`, `odgovorenoAnonimno`) VALUES
(1, 1, 2, 'Zdravo! I sam sam se borio sa istim problemom, ali sam ga uspeno reio uz pomo psihologa. Preporuujem ti da ne uzima sam na svoju ruku nijednu vrstu leka, jer posledice mogu biti opasne. Proslo je 2 godine od kada sam imao fizike probleme odsnosno stezanje u grlo i znam kako ti je. Sreno!', b'1'),
(2, 1, 6, 'Potovani, U svojoj dugogodninjoj praksi sam se mnogo puta susretao sa pacijentima koji su imali isti ili slian problem kao to je Va. Nikako nemojte da uzimate lekove na svoju ruku, jer to moe dovesti do naglih promena raspoloenja i samog statusa organizma, pa kad izazvati da se oseate gore nego trenutno. Vano je praviti male korake ka uspehu. Najbolje bi bilo da kroz sve situacije koje predstavljaju okida na poetku prolazite uz pomo bliske osobe uz koju se osecae sigurno i zatieno. Za vie informacija stojim Vam na raspolaganju.', b'0'),
(3, 2, 1, 'To nije problem koji se reava preko noi, samo strpljivo. Ja bih ti preporuio da potrai strunu pomo', b'1'),
(4, 3, 6, 'Potovani, Nemojte previe da budete zabrinuti. Nain na koji razmiljate i kako se oseate nije nita neobian. Svi mi smo imali takve faze u ivotu, ali je bitno uoiti problem na vreme i raditi na njemu. Pozdrav!', b'0'),
(5, 3, 7, 'Drago mi je da ste postavili ovo pitanje, zato to je to jedan od najeih problema dananjice. Voleo bih da Vam pomognem, ali je to nemogue putem kratkog odgovora. Preporuio bih Vam da se prijavite na neku od seansi koje se bave ba temom koja i Vas mui. Za Vie informacija, slobodno me kontaktirajte.', b'0'),
(6, 2, 3, 'ao, ja znam sve o depresiji!', b'1'),
(7, 2, 3, 'ao 2', b'1'),
(8, 2, 3, 'asdasdasdasd ANONIMNO', b'1'),
(9, 2, 1, 'Test odgovor 123', b'1'),
(10, 2, 3, 'Test odgovor 1.', b'0'),
(11, 2, 3, 'Neki tekst 123', b'0'),
(12, 2, 3, 'Neki tekst 123', b'0'),
(13, 2, 3, 'Neki tekst 123', b'0');

DROP TABLE IF EXISTS `pitanje`;
CREATE TABLE IF NOT EXISTS `pitanje` (
  `idPitanje` int UNSIGNED NOT NULL AUTO_INCREMENT,
  `korisnik_idKorisnik_postavio` int UNSIGNED NOT NULL,
  `kategorijaPitanja_idKategorija` int UNSIGNED DEFAULT NULL,
  `naslovPitanja` varchar(128) NOT NULL,
  `tekstPitanja` text NOT NULL,
  `postavljenoAnonimno` bit(1) NOT NULL COMMENT '\n',
  `moguSviDaOdgovore` bit(1) NOT NULL,
  PRIMARY KEY (`idPitanje`),
  KEY `fk_pitanje_korisnik_idx` (`korisnik_idKorisnik_postavio`),
  KEY `fk_pitanje_kategorijaPitanja1_idx` (`kategorijaPitanja_idKategorija`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

INSERT INTO `pitanje` (`idPitanje`, `korisnik_idKorisnik_postavio`, `kategorijaPitanja_idKategorija`, `naslovPitanja`, `tekstPitanja`, `postavljenoAnonimno`, `moguSviDaOdgovore`) VALUES
(1, 1, 3, 'Problemi sa paninim napadima', 'Jako dugo imam probleme sa paninim napadima. Oseam stezanje u grlu sto je postalo ba problem sada, uzimao sam lekove kao terapiju sto mi je psihijatar prepisao i sam sam prestao da ih uzimam. Smatrao sam da mi vie ne trebaju. Prole nedelje sam imao uestale napade. Imam fizicke probleme kao stezanje u grlu i bol srca. Kako da pomognem sam sebi? Da li je bolje posavetovati se sa strunim licem ili da sam nastavim sa prethodnom terapijom?', b'0', b'1'),
(2, 2, 1, 'Anksioznost', 'Anksioznost je problem koji me mui ve godinama. Pokuavala sam na razne naine da ga reim, ila sam kod psihologa i psihijatra, ali nije bilo veih poboljanja. Moda zato to nisam bila spremna da otvoreno govorim sa njima. Strah me je da podelim priu sa bliskim osobama, jer ne znam da li e me razumeti. Niko ne razume koliko truda ulaem u svakodnevne razgovore, ma koliko oni bili kratki. Plaim se raznih stvari i imam obiaj da ruke perem vie puta detaljno, da mi cela kua bude sreena. Da li je ovo stvarno anksioznost ili moe biti neto drugo? Kome da se obratim?', b'1', b'1'),
(3, 3, 7, 'Ne verujem u sebe', 'U poslednje vreme ne verujem sopstvenom miljenju, preterano razmisljam o svemu i strah me je da prihvatim izazove. Konstantno sam zabrinut da neu postii sve to sam eleo. Zbog toga sam esto previe strog prema sebi, a popustljiv prema drugima. Voleo bih to da promenim, pa Vas molim za savet.', b'1', b'0'),
(4, 4, 8, 'Da li imam OKP?', 'Sve je poelo u januaru ove godine, anksioznost, depresija itd. Imao sam maltene strah o budunosti, ta e se desiti, kasnije je poela kola imao sam jako slabu koncetraciju, nisam mogao da pratim profesora ta govori, a odlian sam ak te mi je to ilo na muku. Otiao sam kod pishologa, objasnio joj sve ona me poslala kod psihijatra, ali nita nije pomoglo. Da li imam OKP?', b'0', b'0'),
(5, 5, 9, 'Mislim da bolujem od depersonalizacije', 'Zdravo! Jako bi mi znaio savet povodom simptoma koje trenutno imam: oseam kao da sam izvan svog tela, ponekad kao da gledam sebe odozgo, oseam da sam odvojen od sebe, kao da, zapravo, nemam sebe,blokada u umu ili telu, kao da su mi ula iskljuena, kao da ne mogu da kontroliem ta radim ili ta izgovaram. Da li je mogue da imam depersonalizaciju i kako da je reim? Hvala na odgovoru!', b'0', b'1'),
(6, 7, NULL, 'teeettsss', 'asdasdebhkjsddscjdfsnesno', b'1', b'1');

