(1, 7, 'Socijalna anksioznost i kako je prevazii', 'Dobrodoli. Cilj ove seanse je da se doslednim nainom pomogne da prevaziete poremeaj socijalne anksioznosti, ponekad zvane socijalna fobija koju ima 7 do 8 procenata populacije i jedna je od najveih mentalnih i zdravstvenih problema na svetu. Prevazilaenje socijalne anksioznosti nije lak zadatak. Govorimo o reprogramiranju naina na koji razmiljate, menjanju naina na koji opaate stvari i olakavanje vaeg ivota i to na nain na koji vi to elite.', 5, '2021-06-24', '13:00:00', 'http://localhost:8080/Psiholog/profil/444'),
(9, 7, 'asdasdasd', 'asdasd', 3, '2021-06-23', '02:31:00', 'https://www.facebook.com/');

